import logo from './logo.svg';
import './App.css';
import './components/nav'
import axios from 'axios'
import { useState } from 'react';
function App() {
  const [name,setName]=useState;
  axios.get('http://localhost:8080/api/users')
  .then((reponse) => {
    setName(reponse.data);
  });

  return (
    <div className="App">
     <nav name={name}/>
    </div>
  );
}

export default App;
